import logo from "./wizard.gif";
import "./App.css";

function App() {
	return (
		<div className='container'>
			<div className='row'>
				<div className='col-xs-1' align="center">
          <div className="terminal shadow" data-bs-theme="light" align="left">
          <span class="green"><i class="fa-solid fa-ghost"/>&nbsp;&nbsp;cat</span> <span class="orange"> <a class="orange" href="#about_me">about_me.txt</a></span>
          </div>
        </div>
			</div>
		</div>
	);
}

export default App;
